      out.write("function bind_add_tag() {\n");
      out.write("\t// tag 설정 추가\n");
      out.write("\t$(\".add_tag_img\").click(function() {\n");
      out.write("\t\tvar c = $(\"#sample_tag\").clone(true);\n");
      out.write("\t\tc.find(\"input\").val(\"\");\n");
      out.write("\t\tvar $p2 = pN($(this), 2);\n");
      out.write("\t\tvar $p5 = pN($(this), 5);\n");
      out.write("\t\t\n");
      out.write("\t\tvar tags = $p5.find(\"input[name=tags]\");\n");
      out.write("\t\ttags.val(parseInt(tags.val()) + 1);\n");
      out.write("\t\t\n");
      out.write("\t\tvar $t = $p2.find(\".tag_div\");\n");
      out.write("\t\tc.css({display:'none'});\n");
      out.write("\t\tc.prependTo($t).show(\"slow\");\n");
      out.write("\t\tc.removeClass(\"hidden\");\n");
      out.write("\t});\n");
      out.write("}\n");
      out.write("\n");
      out.write("function bind_del_tag() {\n");
      out.write("\t$(\".del_tag_img\").click(function() {\n");
