      out.write("\t\ttags.val(parseInt(tags.val()) - 1);\n");
      out.write("\t\t\n");
      out.write("\t\tvar $p4 = pN($(this), 4);\n");
      out.write("\t\t$p4.hide(\"slow\", function() { $p4.remove(); });\n");
      out.write("\t});\n");
      out.write("}\n");
      out.write("\n");
      out.write("function bind_add_config() {\n");
      out.write("\t// config 설정 추가\n");
      out.write("\t$(\".add_config_img\").click(function() {\n");
      out.write("\t\tvar c = $(\"#sample_config\").clone(true);\n");
